{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[],"authorship_tag":"ABX9TyMntg1qWyK+Boz8mvIZJ6Of"},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"code","execution_count":1,"metadata":{"id":"9PTB2l2RGNNR","colab":{"base_uri":"https://localhost:8080/","height":435},"executionInfo":{"status":"ok","timestamp":1761523781736,"user_tz":240,"elapsed":147336,"user":{"displayName":"Derek Gallo","userId":"03745874976630683909"}},"outputId":"b8a1934d-79da-4e3e-a5f7-2890e3c9e5aa"},"outputs":[{"output_type":"display_data","data":{"text/plain":["<Figure size 640x480 with 1 Axes>"],"image/png":"\n"},"metadata":{}}],"source":["#Import libraries\n","import numpy as np\n","import matplotlib.pyplot as plt\n","\n","#Create a 1000 by 1000 array of x,y pairs with x values\n","#between -2 and 1 and y value between -1.5 and 1.5\n","x,y = np.mgrid[-2:1:1000j, -1.5:1.5:1000j]\n","\n","#Create an array of complex numbers\n","c = x + 1j * y\n","\n","#Create an array to store the value of z for each point in c\n","mandelbrot_set = np.zeros(c.shape)\n","\n","#Iterate through each point in c\n","for i in range(c.shape[0]):\n","    for j in range(c.shape[1]):\n","        #Initialize variables\n","        z = 0\n","        iterations = 0\n","        #Perform the Mandelbrot test\n","        while abs(z) < 50 and iterations < 1000:\n","            z = z ** 2 + c[i, j]\n","            iterations += 1\n","        #Store the absolute value of z\n","        mandelbrot_set[i, j] = abs(z)\n","\n","#Mask the points that converged (z < 50)\n","mask = mandelbrot_set < 50\n","\n","#Plot the discovered Mandelbrot fractal\n","plt.grid(linestyle = '--', linewidth = .5)\n","plt.imshow(mask.T, extent = (-2 , 1, -1.5 , 1.5))\n","plt.gray()\n","plt.savefig('mandelbrot.png')\n","plt.show()"]}]}